/// Get the LineBreak attribute for a Unicode code-point.
///
/// # Arguments
///  - `code_point` A code-point in the form of a rust `char`.
///
/// # Returns
/// A LineBreak attribute of the Unicode code-point.
#[must_use] pub const fn get_line_break(code_point: char) -> LineBreak
{
    const INDEX_MASK : usize = (1 << LINE_BREAK_INDEX_BITS) - 1;
    const COLUMN_MASK : usize = (1 << LINE_BREAK_COLUMN_BITS) - 1;

    let code_point_value = code_point as usize;
    let code_point_lo = code_point_value % LINE_BREAK_CHUNK_SIZE;
    let mut code_point_hi = code_point_value / LINE_BREAK_CHUNK_SIZE;
    if code_point_hi > LINE_BREAK_INDEX_LEN - 1 {
        code_point_hi = LINE_BREAK_INDEX_LEN - 1;
    }

    let index_offset = code_point_hi * LINE_BREAK_INDEX_BITS;
    let index_byte_offset = index_offset / 8;
    let index_bit_offset = index_offset % 8;
    let mut index: usize = 0;
    index |= (LINE_BREAK_DATA[LINE_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 1] as usize) << 8;
    index |= (LINE_BREAK_DATA[LINE_BREAK_INDEX_BYTE_OFFSET + index_byte_offset + 0] as usize) << 0;
    index >>= index_bit_offset;
    index &= INDEX_MASK;

    let column_offset = (index * LINE_BREAK_CHUNK_SIZE + code_point_lo) * LINE_BREAK_COLUMN_BITS;
    let column_byte_offset = column_offset / 8;
    let column_bit_offset = column_offset % 8;

    let mut value: usize = 0;
    value |= (LINE_BREAK_DATA[column_byte_offset + 1] as usize) << 8;
    value |= (LINE_BREAK_DATA[column_byte_offset + 0] as usize) << 0;
    value >>= column_bit_offset;
    value &= COLUMN_MASK;

    return match value {
        0 => LineBreak::Xx,
        1 => LineBreak::Cm,
        2 => LineBreak::Ba,
        3 => LineBreak::Lf,
        4 => LineBreak::Bk,
        5 => LineBreak::Cr,
        6 => LineBreak::Sp,
        7 => LineBreak::Ex,
        8 => LineBreak::Qu,
        9 => LineBreak::Al,
        10 => LineBreak::Pr,
        11 => LineBreak::Po,
        12 => LineBreak::Op,
        13 => LineBreak::Cp,
        14 => LineBreak::Is,
        15 => LineBreak::Hy,
        16 => LineBreak::Sy,
        17 => LineBreak::Nu,
        18 => LineBreak::Cl,
        19 => LineBreak::Nl,
        20 => LineBreak::Gl,
        21 => LineBreak::Ai,
        22 => LineBreak::Bb,
        23 => LineBreak::Hl,
        24 => LineBreak::Sa,
        25 => LineBreak::Jl,
        26 => LineBreak::Jv,
        27 => LineBreak::Jt,
        28 => LineBreak::Ns,
        29 => LineBreak::Ak,
        30 => LineBreak::Vi,
        31 => LineBreak::As,
        32 => LineBreak::Id,
        33 => LineBreak::Vf,
        34 => LineBreak::Zw,
        35 => LineBreak::Zwj,
        36 => LineBreak::B,
        37 => LineBreak::In,
        38 => LineBreak::Wj,
        39 => LineBreak::Eb,
        40 => LineBreak::Cj,
        41 => LineBreak::H,
        42 => LineBreak::Sg,
        43 => LineBreak::Cb,
        44 => LineBreak::Ap,
        45 => LineBreak::Ri,
        46 => LineBreak::Em,
        _ => LineBreak::Xx,
    };
}

#[cfg(all(test, not(debug_assertions)))]
#[test]
fn line_break_full_coverage()
{
    for c in '\u{0000}'..='\u{d7ff}' {
        let _ = get_line_break(c);
    }
    for c in '\u{e000}'..='\u{10ffff}' {
        let _ = get_line_break(c);
    }
}

